import react from "react";
import { Firstname } from "./App";
import { Lastname } from "./App";




const ComC=()=>{
    return(
        <>
            <Firstname.Consumer>{(fname)=>{

                <Lastname.Consumer>
                    {(Lname)=>{
                        return<h1>My name is {fname} {Lname}</h1>

                    }}
                </Lastname.Consumer>



               
            }}</Firstname.Consumer>

            
        </>
    )
}
export default ComC;
